import React, { useState } from 'react';
import 'tailwindcss/tailwind.css';

const Form = () => {
  const [phoneNumber, setPhoneNumber] = useState('');
  const [personality, setPersonality] = useState('');
  const [startTime, setStartTime] = useState('');
  const [endTime, setEndTime] = useState('');

  const handlePhoneNumberChange = (e) => {
    setPhoneNumber(e.target.value);
  };

  const handlePersonalityChange = (e) => {
    setPersonality(e.target.value);
  };

  const handleStartTimeChange = (e) => {
    setStartTime(e.target.value);
  };

  const handleEndTimeChange = (e) => {
    setEndTime(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Phone Number:', phoneNumber);
    console.log('Personality:', personality);
    console.log('Available Time:', startTime, 'to', endTime);
  };

  return (
    <div className="flex items-center justify-center min-h-screen bg-pink-50">
      <div className="bg-white shadow-lg rounded-lg p-8 max-w-md min-w-md w-full">
        <h2 className="text-2xl font-semibold text-center text-pink-600 mb-4">Personalization Form</h2>
        <form onSubmit={handleSubmit}>
          <div className="mb-4">
            <label className="block text-pink-600 text-sm font-bold mb-2" htmlFor="phone">
              Phone Number
            </label>
            <input
              type="text"
              id="phone"
              value={phoneNumber}
              onChange={handlePhoneNumberChange}
              className="input input-bordered w-full bg-white text-pink-600"
              placeholder="Enter your phone number"
            />
          </div>
          <div className="mb-4">
            <label className="block text-pink-600 text-sm font-bold mb-2" htmlFor="personality">
              Personality Type
            </label>
            <select
              id="personality"
              value={personality}
              onChange={handlePersonalityChange}
              className="select select-bordered w-full bg-white text-pink-600"
            >
              <option value="" disabled>Select your personality</option>
              <option value="friendly">Friendly</option>
              <option value="professional">Professional</option>
              <option value="funny">Funny</option>
              <option value="serious">Serious</option>
            </select>
          </div>
          <div className="mb-4 grid grid-cols-2 gap-4 items-center">
            <div>
              <label className="block text-pink-600 text-sm font-bold mb-2" htmlFor="start-time">
                Available From
              </label>
              <input
                type="time"
                id="start-time"
                value={startTime}
                onChange={handleStartTimeChange}
                className="input input-bordered w-full bg-white text-pink-600"
              />
            </div>
            <div className="h-full w-px bg-pink-300 mx-4" />
            <div>
              <label className="block text-pink-600 text-sm font-bold mb-2" htmlFor="end-time">
                Available Until
              </label>
              <input
                type="time"
                id="end-time"
                value={endTime}
                onChange={handleEndTimeChange}
                className="input input-bordered w-full bg-white text-pink-600"
              />
            </div>
          </div>
          <div className="flex items-center justify-between">
            <button
              type="submit"
              className="btn btn-primary border-none w-full text-white font-bold py-2 px-4 rounded bg-pink-600 hover:bg-pink-700"
            >
              Submit
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default Form;
